import React from 'react';
import { useNavigate } from 'react-router-dom';
import BG from './image/logo/admin_home.png';
import './css/App.css';

function Admin_Home() {
  const navigate = useNavigate();

  return (
    <div className="admin-home-container">
      <img src={BG} alt="UGBN" className="admin-home-background-image" />

      <button className="admin-options-button" onClick={navigate('/Admin_Options')} style={{ fontSize: '30px' }}>
      </button>
    </div>
  );
}

export default Admin_Home;
